import React, { useState, useEffect } from 'react';

function UpdateContact() {
    const [data, setData] = useState([]);
    const apiUrl = 'http://localhost:8080/'; // Replace with your API endpoint URL

    useEffect(() => {
        // Fetch data from the API endpoint when the component mounts
        fetchData();
    }, []);

    const fetchData = () => {
        // Fetch data from the API endpoint
        fetch(apiUrl)
            .then((response) => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then((jsonData) => {
                setData(jsonData); // Update the state with the fetched data
            })
            .catch((error) => {
                console.error('Error fetching data:', error);
            });
    };

    const handleDelete = (name) => {
        // Construct the API endpoint URL for deleting the item with the given ID
        const deleteApiUrl = `http://localhost:8080/delete-user/${name}`; // Replace with the delete endpoint URL

        // Send a DELETE request to the delete endpoint
        fetch(deleteApiUrl, {
            method: 'DELETE',
        })
            .then((response) => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                // Remove the deleted item from the data in state
                const updatedData = data.filter((item) => item.Name !== name);
                setData(updatedData);
            })
            .catch((error) => {
                console.error('Error deleting data:', error);
            });
    };

   
}

export default UpdateContact;
